    "import numpy as np\n",
    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "from scipy.stats import gamma\n",
    "from sklearn.ensemble import RandomForestClassifier\n",
    "from sklearn.metrics import accuracy_score\n",
    "\n",
    "# Load IMERG data (assuming a CSV with daily precipitation)\n",
    "data = df\n",
    "\n",
    "# Ensure 'date' column is in datetime format\n",
    "data['date'] = pd.to_datetime(data['date'])\n",
    "\n",
    "# Split data into training (20152021) and testing (20222024)\n",
    "train_data = data[(data['date'].dt.year >= 2015) & (data['date'].dt.year <= 2021)]\n",
    "test_data = data[(data['date'].dt.year >= 2022) & (data['date'].dt.year <= 2024)]\n",
    "\n",
    "# Extract precipitation and features\n",
    "precip_train = train_data['rainfall']  # Daily precipitation in mm (training)\n",
    "precip_test = test_data['rainfall']    # Daily precipitation in mm (testing)\n",
    "\n",
    "# Handle zeros and non-zeros separately for training data\n",
    "is_rainy_train = (precip_train > 0).astype(int)  # Binary indicator for rain (training)\n",
    "nonzero_precip_train = precip_train[precip_train > 0]  # Non-zero precipitation values (training)\n",
    "\n",
    "# Log-transform non-zero values for visualization\n",
    "log_nonzero_precip_train = np.log1p(nonzero_precip_train)\n",
    "\n",
    "# Visualize distribution of non-zero precipitation (training data)\n",
    "plt.hist(log_nonzero_precip_train, bins=50, density=True, alpha=0.7, label='Log-transformed (20152021)')\n",
    "plt.title('Distribution of Log-Transformed Non-Zero Precipitation (Training Data)')\n",
    "plt.xlabel('Log(Precipitation + 1)')\n",
    "plt.ylabel('Density')\n",
    "plt.legend()\n",
    "plt.show()\n",
    "\n",
    "# Fit a gamma distribution to non-zero precipitation (training data)\n",
    "shape, loc, scale = gamma.fit(nonzero_precip_train, floc=0)  # Fix location to 0\n",
    "print(f\"Gamma distribution parameters (training data): shape={shape:.4f}, scale={scale:.4f}\")\n",
    "\n",
    "# Prepare features and target for Random Forest\n",
    "X_train = train_data[['soil_moisture', 'elev_mean', 'slope_mean']]  # Features for training\n",
    "y_train = is_rainy_train  # Target for training (rain vs. no rain)\n",
    "X_test = test_data[['soil_moisture', 'elev_mean', 'slope_mean']]   # Features for testing\n",
    "y_test = (precip_test > 0).astype(int)  # Target for testing\n",
    "\n",
    "# Train Random Forest Classifier\n",
    "model = RandomForestClassifier(class_weight='balanced', random_state=42)\n",
    "model.fit(X_train, y_train)\n",
    "\n",
    "# Evaluate model on test data (20222024)\n",
    "y_pred = model.predict(X_test)\n",
    "accuracy = accuracy_score(y_test, y_pred)\n",
    "print(f\"Model accuracy on test data (20222024): {accuracy:.4f}\")\n",
    "\n",
    "# Optional: Analyze non-zero precipitation in test data for comparison\n",
    "nonzero_precip_test = precip_test[precip_test > 0]\n",
