    "import numpy as np\n",
    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "from scipy.stats import gamma\n",
    "from sklearn.ensemble import RandomForestClassifier\n",
    "from sklearn.metrics import classification_report\n",
    "\n",
    "# 1. Make sure your DataFrame has a datetime 'date' column\n",
    "df['date'] = pd.to_datetime(df['date'])\n",
    "\n",
    "# 2. Split into train/test based on year\n",
    "train = df[(df['date'].dt.year >= 2015) & (df['date'].dt.year <= 2021)].copy()\n",
    "test  = df[(df['date'].dt.year >= 2022) & (df['date'].dt.year <= 2024)].copy()\n",
    "\n",
    "# 3. Extract precipitation and binary rain flag for each set\n",
    "precip_train      = train['rainfall']\n",
    "is_rainy_train    = (precip_train > 0).astype(int)\n",
    "nonzero_precip_tr = precip_train[precip_train > 0]\n",
    "\n",
    "precip_test       = test['rainfall']\n",
    "is_rainy_test     = (precip_test > 0).astype(int)\n",
    "\n",
    "# 4. Logtransform only the nonzero training precipitation\n",
    "log_nonzero_tr = np.log1p(nonzero_precip_tr)\n",
    "\n",
    "# 5. Visualize the train distribution\n",
    "plt.hist(log_nonzero_tr, bins=50, density=True, alpha=0.7)\n",
    "plt.title('Train: LogTransformed NonZero Precipitation (20152021)')\n",
    "plt.xlabel('Log(precip + 1)')\n",
    "plt.ylabel('Density')\n",
    "plt.show()\n",
    "\n",
    "# 6. Fit a gamma distribution on the TRAIN nonzero precip\n",
    "shape, loc, scale = gamma.fit(nonzero_precip_tr, floc=0)\n",
    "print(f\"Gamma params (train): shape={shape:.3f}, scale={scale:.3f}\")\n",
    "\n",
    "# 7. Prepare your feature matrices and labels\n",
    "features = ['soil_moisture', 'elev_mean', 'slope_mean']\n",
    "\n",
    "X_train = train[features]\n",
    "y_train = is_rainy_train\n",
    "\n",
    "X_test  = test[features]\n",
    "y_test  = is_rainy_test\n",
    "\n",
    "# 8. Train a Random Forest on the training period\n",
    "model = RandomForestClassifier(class_weight='balanced', random_state=42)\n",
    "model.fit(X_train, y_train)\n",
    "\n",
    "# 9. Evaluate on the heldout period\n",
    "y_pred = model.predict(X_test)\n",
    "print(\"Test accuracy:\", model.score(X_test, y_test))\n",
    "print(classification_report(y_test, y_pred))\n"
